using SpecialFunctions
export LEBasis
"""
Laplacian eigenfunctions

basis computed on the fly, as with ChebBasis
"""
struct LEBasis <: ScalarPoly4MLBasis
   N::Int
   L::Int
   cutoff::Real
end

LEBasis(N::Integer, L::Integer, cutoff::Real) = LEBasis(N, L, cutoff,)

# Base.length(basis::ChebBasis) = basis.N

# natural_indices(basis::ChebBasis) = 0:length(basis)-1

# _valtype(basis::ChebBasis, T::Type{<:Real}) = T


function evaluate!(P::AbstractArray, basis::LEBasis, x::Real)
   # P[L, N]
   N = basis.N
   L = basis.L
   cutoff = basis.cutoff
   @show N, L, size(P)
   @assert 1 <= N <= 100
   @assert 0 <= L <= 100
   @assert size(P) >= (L+1, N)

   # Evaluate
   for n1 in 1:N
      for l1 in 0:L
         #nth zero of lth spherical bessel function
         z_nl = jn_zeros[n1][l1+1]
         #normalisation factor.
         N_nl = (cutoff^3/2)^0.5 * sphericalbesselj(l1+1, z_nl)
         @inbounds P[l1+1, n1] = sphericalbesselj(l1, x/cutoff*z_nl)/N_nl
      end
   end

   return P
end



